const WorldMapSvgContainer = styled.svg`
	display: block;
	margin: 0 auto;
	width: 100%;
	z-index: 1;
	transition: 1.3s all;
	position: ${(props) => (props.server ? 'static' : 'relative')};
	transform: ${(props) =>
		props.server === SERVER_LOCATION.USA
			? 'scale(2.25) translateX(300px)'
			: props.server === SERVER_LOCATION.EUROPE
			? 'scale(2.25) translateX(-375px) translateY(60px)'
			: ''};
`;
const UsaG = styled.g`
	fill: ${(props) =>
		props.server === SERVER_LOCATION.USA ? 'white' : '#9EA2BC'};
	cursor: pointer;
	transition: 2s all;
	transform: scale(1.15) translateX(-70px) translateY(-60px);
	& path {
		transition: 0.3s all;
		fill: #9ea2bc;
	}

	&:hover {
		& path {
			fill: white;
		}
	}
	.active path {
		fill: white;
	}
`;

const EuropePath = styled.path`
  fill: ${(props) =>
		props.server === SERVER_LOCATION.EUROPE ? 'white' : '#9EA2BC'};
  cursor: pointer;
  transition: 0.3s all; 
  &:hover {
    fill: white;
  },
`;
